svg.script:
 
    
	function circle_click(evt) {
		
			var lastNode;
			var currentNode;
			var hsParentNode;

			currentNode = evt.target;
			hsParentNode = currentNode.parentNode;

			while (hsParentNode.parentNode.getAttribute("id") == null)
			{
				hsParentNode = hsParentNode.parentNode;
			
			}
			
			hsParentNode.getElementsByTagName("rect")[0].setAttribute("stroke","#FF0000");
			window.parent.document.getElementById("HSText").value = hsParentNode.getElementsByTagName("text")[0].textContent
			
			lastNode = currentNode.ownerDocument.getElementById("lastnode");
			
			if (lastNode !== null)
			{
				currentNode.parentNode.ownerDocument.getElementById("lastnode").setAttribute("stroke","#000000");
				currentNode.parentNode.ownerDocument.getElementById("lastnode").removeAttribute("id");
				currentNode.parentNode.getElementsByTagName("rect")[0].setAttribute("id","lastnode");
			}
	      		else
	      		{
				currentNode.parentNode.getElementsByTagName("rect")[0].setAttribute("id","lastnode");
			}
	}
